const logoImage = "data:image/png;base64,";

import React, { useEffect } from "react";
// import { logoImage } from "../../assets";
import { useAppQuery, useAuthenticatedFetch } from "../../hooks";

import {
  Frame, TopBar, Toast, ActionList, ContextualSaveBar, Loading,
  Modal, FormLayout, TextField, Navigation
} from "@shopify/polaris";

import {
  QuestionMarkMajor, SettingsMajor, HomeMajor,
  ArrowLeftMinor, OrdersMajor, ConversationMinor,
  PlanMajor
} from "@shopify/polaris-icons";

import { useState, useCallback, useRef } from 'react';
import { useLocation } from 'react-router-dom';

const SEARCH_QUERY = `query findProduct($query: String) {
  products(first: 10, query: $query) {
    edges {
      node {
        id
        title
        handle
        featuredImage {
          url
        }
      }
    }
  }
}`;
function imageWithText(image, text) {
  return `data:image/svg+xml;utf8,
  <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 130 100">
    <image href="${image}" x="0" y="25" width="50" height="50"/><text x="60" y="56" style="font-family: -apple-system, BlinkMacSystemFont, 'San Francisco', 'Segoe UI', Roboto, 'Helvetica Neue', sans-serif">${text}</text>
  </svg>`;
  }
export function FrameProvider({ children }) {
  const location = useLocation();
  const afetch = useAuthenticatedFetch();
  const defaultState = useRef({
    emailFieldValue: 'user@abimage.app',
    nameFieldValue: 'Name Surname',
  });
  const skipToContentRef = useRef(null);
  const [toastActive, setToastActive] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [isDirty, setIsDirty] = useState(false);
  const [searchActive, setSearchActive] = useState(false);
  const [searchValue, setSearchValue] = useState('');
  const [userMenuActive, setUserMenuActive] = useState(false);
  const [mobileNavigationActive, setMobileNavigationActive] = useState(false);
  const [modalActive, setModalActive] = useState(false);
  const [searchResults, setSearchResults] = useState([{content: 'Shopify help center'}, {content: 'Community forums'}]);
  useEffect(() => {
    (async () => {
      const response = await afetch('/api/user');
      const user = await response.json();
      
      console.log('user', user);
      setNameFieldValue(`${user.first_name} ${user.last_name}`);
      setEmailFieldValue(user.email);
    })();

    return () => {};
  }, []);
  const [nameFieldValue, setNameFieldValue] = useState(
    defaultState.current.nameFieldValue,
  );
  const [emailFieldValue, setEmailFieldValue] = useState(
    defaultState.current.emailFieldValue,
  );
  const [storeName, setStoreName] = useState(
    defaultState.current.nameFieldValue,
  );
  const [supportSubject, setSupportSubject] = useState('');
  const [supportMessage, setSupportMessage] = useState('');

  const handleSubjectChange = useCallback(
    (value) => setSupportSubject(value),
    [],
  );
  const handleMessageChange = useCallback(
    (value) => setSupportMessage(value),
    [],
  );
  const handleDiscard = useCallback(() => {
    setEmailFieldValue(defaultState.current.emailFieldValue);
    setNameFieldValue(defaultState.current.nameFieldValue);
    setIsDirty(false);
  }, []);
  const handleSave = useCallback(() => {
    defaultState.current.nameFieldValue = nameFieldValue;
    defaultState.current.emailFieldValue = emailFieldValue;

    setIsDirty(false);
    setToastActive(true);
    setStoreName(defaultState.current.nameFieldValue);
  }, [emailFieldValue, nameFieldValue]);
  const handleNameFieldChange = useCallback((value) => {
    setNameFieldValue(value);
    value && setIsDirty(true);
  }, []);
  const handleEmailFieldChange = useCallback((value) => {
    setEmailFieldValue(value);
    value && setIsDirty(true);
  }, []);
  const handleSearchResultsDismiss = useCallback(() => {
    setSearchActive(false);
    setSearchValue('');
  }, []);
  const handleSearchFieldChange = useCallback((value) => {
    setSearchValue(value);
    setSearchActive(value.length > 0);
  }, []);
  const toggleToastActive = useCallback(
    () => setToastActive((toastActive) => !toastActive),
    [],
  );
  const toggleUserMenuActive = useCallback(
    () => setUserMenuActive((userMenuActive) => !userMenuActive),
    [],
  );
  const toggleMobileNavigationActive = useCallback(
    () =>
      setMobileNavigationActive(
        (mobileNavigationActive) => !mobileNavigationActive,
      ),
    [],
  );
  const toggleIsLoading = useCallback(
    () => setIsLoading((isLoading) => !isLoading),
    [],
  );
  const toggleModalActive = useCallback(
    () => setModalActive((modalActive) => !modalActive),
    [],
  );

  const toastMarkup = toastActive ? (
    <Toast onDismiss={toggleToastActive} content="Changes saved" />
  ) : null;

  useEffect(() => { 
    (async () => {
      await afetch('/api/graphql/proxy', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          query: SEARCH_QUERY,
          variables: {
            query: searchValue,
          }
        }),
      }).then(async (response) => {
        const data = await response.json();
        console.log("FrameProvider: useEffect: data: ", data);
        setSearchResults(data.data.products.edges.map(edge => ({ content: edge.node.title, url: `/product/${edge.node.handle}`, image: edge.node.featuredImage.url } )));
      })
      .catch((error) => {
        console.log("FrameProvider: useEffect: error: ", error);
      });
    })()

    return () => {
      console.log("FrameProvider: useEffect: cleanup");
    }
  }, [searchValue])
  useEffect(() => { 
    console.log("FrameProvider: useEffect: location: ", location);
  }, [location]);
  const navigationMarkup = (
    <Navigation location="/">
      <Navigation.Section
        title="A/Bimage"
        items={[
          {
            label: 'Homepage',
            icon: HomeMajor,
            url: '/',
            selected: location.pathname === '/',
          },
          {
            label: 'Reports',
            icon: OrdersMajor,
            url: '/reports',
            selected: location.pathname === '/reports',
          },
          {
            label: 'Billing',
            icon: PlanMajor,
            url: '/billing',
            selected: location.pathname === '/billing',
          },
          {
            label: 'Settings',
            icon: SettingsMajor,
            url: '/settings',
            selected: location.pathname === '/settings',
          },
        ]}
        action={{
          icon: ConversationMinor,
          accessibilityLabel: 'Contact support',
          onClick: toggleModalActive,
        }}
      />
    </Navigation>
  );

  const logo = {
    width: 120,
    topBarSource: imageWithText(logoImage, 'A/Bimage'),
    contextualSaveBarSource: logoImage,
    url: '#',
    accessibilityLabel: 'A/Bimage',
  };

  const userMenuActions = [
    {
      items: [{
        content: 'Support',
        icon: QuestionMarkMajor,
        onAction: toggleModalActive,
      }],
    },
  ];

  const userMenuMarkup = (
    <TopBar.UserMenu
      actions={userMenuActions}
      name={nameFieldValue}
      detail={emailFieldValue}
      initials={(nameFieldValue||'A')[0]}
      open={userMenuActive}
      onToggle={toggleUserMenuActive}
    />
  );
  const searchResultsMarkup = (
    <ActionList
      items={searchResults}
    />
  );
  const searchFieldMarkup = (
    <TopBar.SearchField
      onChange={handleSearchFieldChange}
      value={searchValue}
      placeholder="Search"
    />
  );
  const topBarMarkup = (
    <TopBar
      showNavigationToggle
      userMenu={userMenuMarkup}
      searchResultsVisible={searchActive}
      searchField={searchFieldMarkup}
      searchResults={searchResultsMarkup}
      onSearchResultsDismiss={handleSearchResultsDismiss}
      onNavigationToggle={toggleMobileNavigationActive}
    />
  );

  const contextualSaveBarMarkup = isDirty ? (
    <ContextualSaveBar
      message="Unsaved changes"
      saveAction={{
        onAction: handleSave,
      }}
      discardAction={{
        onAction: handleDiscard,
      }}
    />
  ) : null;

  const loadingMarkup = isLoading ? <Loading /> : null;


  const modalMarkup = (
    <Modal
      open={modalActive}
      onClose={toggleModalActive}
      title="Contact support"
      primaryAction={{
        content: 'Send',
        onAction: toggleModalActive,
      }}
    >
      <Modal.Section>
        <FormLayout>
          <p>
            Just send the initial message we will follow up with email
          </p>
          <TextField
            label="Subject"
            value={supportSubject}
            onChange={handleSubjectChange}
            autoComplete="off"
          />
          <TextField
            label="Message"
            value={supportMessage}
            onChange={handleMessageChange}
            autoComplete="off"
            multiline
          />
        </FormLayout>
      </Modal.Section>
    </Modal>
  );
  return (<Frame
    logo={{ ...logo, url: imageWithText(logo.url, 'Abimage') }}
    topBar={topBarMarkup}
    navigation={navigationMarkup}
    showMobileNavigation={mobileNavigationActive}
    onNavigationDismiss={toggleMobileNavigationActive}
    skipToContentTarget={skipToContentRef}
  >
    {contextualSaveBarMarkup}
    {loadingMarkup}
    {children}
    {toastMarkup}
    {modalMarkup}
  </Frame>);
}